import {useState, useEffect} from 'react';




const HomePage = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("https://corona.lmao.ninja/all")
            .then(data => data.json())
            .then(cor => {
                setData(cor)
            })

            .catch(error => {
                console.log(error)
            })
    },[])
    console.log(data)
    return (
        <>
            <div>{data.cases}</div>
            <p>{data.dea}</p>
        </>
    );
}

export default HomePage
